import React from "react"

class Example extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      count: 0
    }
  }

  onCount = () => {
    this.setState(prevState => ({
      count: prevState + 10
    }))
  }

  render() {
    const {count} = this.state
    return (
      <div onClick={() => this.onCount} style={{backgroundColor: "red"}}>
        {count}
      </div>
    )
  }
}

export default Example
